The breakdown: Getting in/out-
 My only choice would be a car- the height is key. This allows me to get in/out on my own accord, but what type of cars can fit my portable powerchair inside and intact?

Putting my portable power wheelchair inside and intact-
 Stuck in this bubble of only looking at Vans/Trucks/SUVs as the only means of vehicles available for us #WheelChairUsers, I popped the bubble! Options of cars that could fit my chair intact and inside without any modifications are hatchback types. This would require a portable ramp. Now researching hatchbacks, i found that most wouldnâ€™t work due to the specs of the back door opening up and the amount of cargo space. Using a portable ramp makes the angles of the chair clearing the opening a challenge. Then I remembered a car we rented on a trip overseas, a Volvo station wagon. The back opens in a way you get more height clearance. We had a solution finally, but would it work? Went to the Volvo dealership and put it to the test! Using a 6foot ramp my wife was able to push the chair into the back but was stopped by the arm of my chair. Simple fix, remove the arm... It workedğŸ˜ Both my needs were now metâœ…, well  now what about my wantsğŸ¤” Now in the car realm...all wants were easily met: âœ…want to be able to get in and out without help, âœ…no side loading, âœ…want to ride in the seat of the car not in my portable power chair, âœ…nice looking vehicle, âœ…all the new features like back up cameras/ USB and Bluetooth for music; and no more than 3 years old with reasonable mileage and price. WE FOUND OUR NEW RIDE!!!ğŸ‰After all the frustrations and headaches the victory was even sweeter, getting all needs/wants met without breaking the bank made our 5 month search worth it all.";}i:121;a:1:{s:14:"comments_count";i:3;}i:122;a:1:{s:11:"likes_count";i:5;}i:123;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvGSfcpSi2";}i:124;a:1:{s:5:"image";s:250:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118821637_2042550895878085_8972855978166455407_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=101&_nc_ohc=atoJlNTDB3EAX88bJB_&oh=57025cdb4cb4187eb6494da87cc59f15&oe=5F7E5B83";}i:125;a:1:{s:4:"type";s:7:"sidecar";}i:126;a:1:{s:8:"owner_id";i:85886